牽引フック固定部にマウンティグシャフト・ブラケットプレートを取り付けることで、ライセンスプレートを移設することが出来ます。本体プレート上下および穴位置の選択により、15の装着パターンがお選び頂けます。また、角度についても調整可能となっております。<br><br>せっかくのボディデザインを台無しにしてしまうライセンスプレートを移設することで、ボディデザインをより強調させることが出来ます。また、ライセンスプレートを移設することによりバンパーダクトに走行風をより多く取り込める為、ラジエーター・インタークーラーの冷却効果も上がります。ドレスアップカーユーザーはもちろん、サーキット走行を楽しむユーザーの悩みも解消します。<br><br>※パーキングセンサー（メーカーによってはクリアランスソナーなど名称が異なります）装着車で車輌側にてＯＦＦ設定が出来ない車輌は装着不可となります。◆メーカー品番 ： GRBM08　※適合確認がございますので、ご注文をいただける際には、車種・年式・型式・グレード等を必ずご記入ください。  ※画像は装着イメージです。実際の取り付け位置は車種ごとに異なります。<br><br>対応車種 ： 99～05 BMW 330Xi E46 <br><br><br><br>ボディパーツ | ボディパーツその他<tr><td colspan="2">
