0サーキット走行のマストアイテム！車輌接合部分は安易なボルト熔接タイプとは異なりＪＩＳ規格SGD3材を削り出して製作し、錆防止のメッキ処理は国内工場にて行っております。シャックルとの接合部分やシャフト部分のボルトは国産ステンレスボルトを使用。精度・材質・クオリティにトコトンこだわりました。 <br>シャックル部は可動式で、折りたためば必要以上に突起せず走行の邪魔になりません。装着しておけばコースアウトや万が一の際に、スムーズに作業でき、車輌への負担も最小限ですみます。（無理な箇所への引っ掛けての牽引が回避できます）　<br>■カラー：フラットシルバー　■シャックル内径：50パイ　■メイドインジャパン　■受注生産品　納期2-3週間 <br>対応車種：98-06 アルファロメオ 156 2.0JTS <br>　<br>ボディパーツ/ボディパーツその他<tr><td colspan="2">
